import React from 'react';
import pc from './UserInfo.module.css'
import Preloader from "../../assetss/common/Loader/Loader";

const UserInfo = (props) => {
if(!props.profile){
   return <Preloader/>
}
    return <div className={pc.userdescrition}>
        <div>
        <img src={props.profile.photos.large}/>
        </div>
        <div>
            {props.profile.fullName != null ? 'My name is :' + ' ' +props.profile.fullName  : null}
        </div>
        <div>
            {props.profile.aboutMe != null ? 'Status : ' + props.profile.aboutMe : null}
        </div>
        <div>
            {props.profile.lookingForAJob === true ? 'Im looking for a job' : 'Im had a job'}
        </div>
        </div>
}
export default UserInfo;
